pragma solidity ^0.5.16;

contract Transaction {
     struct TransactionData {
        address sender;
        address recipient;
        uint256 amount;
        uint256 timestamp;
    }

    TransactionData[] public transactions;


    function addTransaction(address _sender, address _recipient, uint256 _amount) public {
        TransactionData memory newTransaction;
        newTransaction.sender = _sender;
        newTransaction.recipient = _recipient;
        newTransaction.amount = _amount;
        newTransaction.timestamp = block.timestamp;

        transactions.push(newTransaction);
    }

    function getTransactionCount() public view returns (uint256) {
        return transactions.length;
    }

    function getTransaction(uint256 index) public view returns (
        address sender,
        address recipient,
        uint256 amount,
        uint256 timestamp
    ) {
        require(index < transactions.length, "Invalid transaction index");

        TransactionData memory transaction = transactions[index];
        return (transaction.sender, transaction.recipient, transaction.amount, transaction.timestamp);
    }
}
